			<h3 class="cma-section-title">Document FAQ</h3>

			<div class="cma-section">
			<p class="cma-text"><strong>What is a MIFR?</strong> A Malware Initial Findings Report (MIFR) is intended to provide organizations with malware analysis in a timely manner. In most instances this report will provide initial indicators for computer and network defense. To request additional analysis, please contact CISA and provide information regarding the level of desired analysis.</p>

			<p class="cma-text"><strong>What is a MAR?</strong> A Malware Analysis Report (MAR) is intended to provide organizations with more detailed malware analysis acquired via manual reverse engineering. To request additional analysis, please contact CISA and provide information regarding the level of desired analysis.</p>

			<p class="cma-text"><strong>Can I edit this document?</strong> This document is not to be edited in any way by recipients. All comments or questions related to this document should be directed to the CISA at 1-888-282-0870 or <a href="https://www.us-cert.govmailto:soc@us-cert.gov">soc@us-cert.gov</a>.</p>

			<p class="cma-text"><strong>Can I submit malware to CISA?</strong> Malware samples can be submitted via three methods:</p>

			<ul class="cma-ul">
				<li>Web: <a href="https://malware.us-cert.gov">https://malware.us-cert.gov</a></li>
				<li>E-Mail: <a href="https://www.us-cert.govmailto:submit@malware.us-cert.gov">submit@malware.us-cert.gov</a></li>
				<li>FTP: ftp.malware.us-cert.gov (anonymous)</li>
			</ul>

			<p class="cma-text">CISA encourages you to report any suspicious activity, including cybersecurity incidents, possible malicious code, software vulnerabilities, and phishing-related scams. Reporting forms can be found on CISA's homepage at <a href="http://www.us-cert.gov">www.us-cert.gov</a>.</p>
